import ReturnWelcome from './Welcome';
import ReturnLine from './Line';
import ReturnQuOte from './Quote';
import ReturnBtn from './Btn';
import ActiF from './Actif/Main';
import ReturnBtnRegister from './BtnRegister/Main';

// Body Main Dash
export default function ReturnBody() {
 return (
  <div className='wrp-body-dash'>
   <ReturnWelcome />
   <ReturnLine />
   <ReturnQuOte />
   <ReturnBtn />
   <ActiF />
   <ReturnBtnRegister />
  </div>
 );
};
